import {useState, useEffect} from 'react';
import styled from 'styled-components';
import Container from '../components/Container';
import {frontEnd} from '../techData.js';

export default function TechStack() {

  return(
    <Container bg={[4,3]}>
      <Title>Tech Stack H:</Title>
      <CardContainer>
        {frontEnd.map((data, index) => (
          <a href={data.link} target="_blank" rel="noreferrer">
          <Card>
            <Logo className="logoVector" name={data.name}/>
            <h3>{data.name}</h3>
          </Card>
          </a>
        ))}
        {frontEnd.map((data, index) => (
          <a href={data.link} target="_blank" rel="noreferrer">
          <Card>
            <Logo className="logoVector" name={data.name}/>
            <h3>{data.name}</h3>
          </Card>
          </a>
        ))}
      </CardContainer>
    </Container>
  )
};

const Title = styled.h1`
  align-self: start;
  color:white;
`;

const CardContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  align-items:space-around;
  justify-content:start;
  width: 100%;
  height: 20em;

  a{
    text-decoration:none;
  }
`;

const Card = styled.div`
  display:flex;
  flex-direction:column;

  background: white;
  color:black;
  padding:0.7em;
  border-radius: 10%;
  text-align: center;
  transition: all 0.5s;

  width:7em;
  height:7em;

  h3{
    font-size: 100%;
    padding:0;
    margin:0;
  }

  :hover{
    width: 8em;
    height:8em;
  }
`;

const Logo = styled.div`
  ${({name}) => `background-image: url(./logos/${name}.svg);`}
  background-repeat: no-repeat;
  background-size: 100% 100%;

  width:100%;
  height:100%;

`;
